      SELECT + col0 * - col2 AS col1 FROM tab1 (FORMAT parquet) WHERE NOT + 43 + - CAST ( NULL AS INTEGER ) + + 31 + - - col1 - - - col0 + col2 BETWEEN - + col0 AND 25;
  - name: tab1

outputs:
  - name: q6328.out
    data: |
